import React from "react";

import Footer from "./pageComponent/Footer";
import TemplateTxt from "./pageComponent/TemplateTxt";

import food from "../img/fabada.jpg"

function RecipeTempl(props){

    return(
        <div >

            <div class="contentbox">   

                <div>
                    <h1>Fabada</h1>
                    <h3>Region: <a href="https://www.google.de/maps/place/Spanien/@40.1910594,-5.9554559,7z/data=!3m1!4b1!4m5!3m4!1s0xc42e3783261bc8b:0xa6ec2c940768a3ec!8m2!3d40.463667!4d-3.74922">Spain</a></h3>
                    <h3>Time: 60 min. - 90 min.</h3>
                </div>

                <img src={food} alt="RecipePicture_NotAvailable"/>

                <div class="contentboxtext">
                    <TemplateTxt></TemplateTxt>
                </div>

                <div class="contentboxtext">
                    <h3>Ingredients: </h3>
                </div>

            </div>

            <Footer></Footer>

        </div>
    ); 
}

export default RecipeTempl;
